import React from "react";

const Contact = () => {
  return (
    <section className="section">
      <h2>Contact Me</h2>
      <p>Email: saisumasarakadam@gmail.com</p>
      <p>LinkedIn: <a href="https://www.linkedin.com/in/sumasarakadam" target="_blank">My Profile</a></p>
    </section>
  );
};

export default Contact;
